import React from 'react';
import SurfPocketMenuIcon from '../src/surfpocketmenu-icon.svg';

const SurfPocketMenuLogo = () => {
  return (
    <div>
      <img src={SurfPocketMenuIcon} alt="SPL" height={60} width={120} />
    </div>
  );
}

export default SurfPocketMenuLogo;
